const Part =(part)=>{
  return(
    <div>
      <p>{part.name} {part.exercises}</p>
    </div>
  )
}

const Header =(head)=>{
  return(
    <div>
      <h1>{head.course}</h1>
    </div>
  )
}

const Content =(items)=>{
  return(
    <div>
      <Part name={items.names[0]} exercises={items.exercises[0]}/>
      <Part name={items.names[1]} exercises={items.exercises[1]}/>
      <Part name={items.names[2]} exercises={items.exercises[2]}/>
    </div>
  )
}

const Total =(total)=>{
  return(
    <div>
        <p>
          Number of exercises {total.exercises[0] + total.exercises[1] +total.exercises[2]}
        </p>
    </div>
  )
}

const App =()=> {
  const course = {
    name: "Half Stack application development",
    parts: [
      {
        name: "Fundamentals of React",
        exercises: 10
      },
      {
        name: "Using props to pass data",
        exercises: 7
      },
      {
        name: "State of a component",
        exercises: 14
      }
    ]
  }

  return (
    <div>
      <Header course={course.name}/>
      <Content names={course.parts.map(obj => obj.name)} exercises={course.parts.map(obj => obj.exercises)} />
      <Total exercises={course.parts.map(obj => obj.exercises)} />
    </div>
  );
}

export default App
